import React, { Component } from 'react'
import { ParallaxLayer } from 'react-spring/renderprops-addons'

class About extends Component {
  render() {
    return(
      <div>
        <ParallaxLayer offset={0.9} speed={1}>
        <h2>Sobre</h2>
        </ParallaxLayer>
      </div>
    )
  }
}

export default About
